import { Link } from "react-router-dom";
import "./Anasayfa.css";


const Anasayfa = () =>{

        return(

        <div className="home-container">

            <div style={{ backgroundColor: '#CE2829'}}>

            <h1>Teknolojik Yemekler</h1>
            <br/>
            <p className="text">KOD ACIKTIRIR,</p>
            <br/>
            <p className="text">PİZZA DOYURUR!</p>

            </div>

            <br />

            <div className="button-container">

                <Link id="order-pizza" to="/pizza">
                    <button type="button" id="acıktım" style={{ backgroundColor: '#ffc107', width:'200%', height: '200%', borderRadius: 50}}> ACIKTIM </button>
                </Link>

            </div>
    
        </div>
    )
}

export default Anasayfa;
